    constructor(){
        super();
        this.state={
            user:{
                email:'',
                password:''
            }
        }
    }
    componentDidMount(){

    }
    onEmailChange=(input)=>{
        const {user}=this.state.user;
        user.email=input.target.value;
        this.setState({user:user});
    }
    onPasswordChange=(input)=>{
        const {user}=this.state.user;
        user.password=input.target.value;
        this.setState({user:user});
    }
